import React from 'react';
import '../stylesheets/home.css';
import store from "../store";




console.log(store.getState())

const Tasks = (store, list) => store.getState()[list].map(i =>
    <li>{i}</li>
)
const TaskLists = (store) => store.getState().ToDoLists.map(i =>
    <li>{i}</li>
)

function Home() {
    return (
        <div className="home">
            <div className="sidebar">
                <ol>
                    {TaskLists(store)}
                </ol>
            </div>
            <ol>
                {Tasks(store, "todos")}
            </ol>
        </div>
    );
}

export default Home;
